import "./login.css";
import logoAuth from './../../img/logo/LogoAuth.png'

export const Login = () => {
  return (
    <section className="Login">
      
        <div className="preview">
        <div className="logo">
          <img src={logoAuth} alt='logo'></img>
        </div>
        
        <span>Вход</span>
        </div>
        <div className="Auth">
          <form>
            
          </form>
        </div>
      
    </section>
  );
};

export default Login
